import React, { Component } from 'react';
import LylicBlock from './LylicBlock';

class YoutubeLylic extends Component {
  constructor(props) {
    super(props);

    const array = this.props.array;
    const listItems = array.map((value) => (
      <LylicBlock key={value} value={value} func={this.props.func} />
    ));
    this.state = {
      list: listItems,
    };
  }
  render() {
    return <div>{this.state.list}</div>;
  }
}

export default YoutubeLylic;
